"""
tiny-qpu Manual Generator
Extracts manual.tex and compiles to PDF using pdflatex.
Requires: pdflatex (TeX Live or MiKTeX) with amsmath, physics, tcolorbox, booktabs, listings packages.
"""
import base64, zlib, os, subprocess

DATA = ""

def install():
    here = os.path.dirname(os.path.abspath(__file__))
    tex_path = os.path.join(here, "manual.tex")
    content = zlib.decompress(base64.b64decode(DATA))
    with open(tex_path, "wb") as f:
        f.write(content)
    print(f"Extracted manual.tex ({len(content):,} bytes)")
    try:
        for i in range(3):
            subprocess.run(["pdflatex", "-interaction=nonstopmode", "manual.tex"],
                           cwd=here, capture_output=True, text=True, timeout=120)
        pdf_path = os.path.join(here, "manual.pdf")
        if os.path.exists(pdf_path):
            size = os.path.getsize(pdf_path)
            final = os.path.join(here, "tiny_qpu_manual.pdf")
            if os.path.exists(final):
                os.remove(final)
            os.rename(pdf_path, final)
            print(f"Generated tiny_qpu_manual.pdf ({size:,} bytes)")
            for ext in [".aux", ".log", ".out", ".toc"]:
                p = os.path.join(here, "manual" + ext)
                if os.path.exists(p):
                    os.remove(p)
        else:
            print("pdflatex produced no PDF. Check manual.log")
    except FileNotFoundError:
        print("pdflatex not found. Install TeX Live/MiKTeX then run:")
        print(f"  cd {here} && pdflatex manual.tex && pdflatex manual.tex && pdflatex manual.tex")
    except Exception as e:
        print(f"Build error: {e}")

if __name__ == "__main__":
    install()
